import express from "express";
import userController from "../controllers/user.controller";
import { userValidation } from "../validations/user.validations";
import {
  checkUserExistByPhone,
  checkUserExist,
} from "../middleware/user.middleware";

const router = express();

router.post(
  "/register",
  userValidation,
  checkUserExistByPhone,
  userController.registerUser
);
router.post("/login", userValidation, checkUserExist, userController.login);

export default router;

import { createUser } from "../services/user.services";
import bcrypt from "bcryptjs";
import { getRole } from "../services/role.services";
import { getToken } from "../util/token";

export class userControllers {
  async registerUser(req, res) {
    try {
      const password = await bcrypt.hash(req.body.password, 12);
      const role = await getRole();
      const newUser = {
        full_name: req.body.full_name,
        email: req.body.email,
        password: password,
        roleId: role.id,
        phone_number: req.body.phone_number,
      };
      const user = await createUser(newUser);
      return res.status(201).json({
        message: `SignUp successfully`,
        user: user,
      });
    } catch (err) {
      return res.status(500).json({
        message: "Error while registering user",
        error: err.message,
      });
    }
  }

  async login(req, res) {
    try {
      const { password } = req.body;
      const user = req.user;
      if (!bcrypt.compareSync(password, user.password)) {
        return res.status(401).json({
          message: "Password does not match",
        });
      }
      const token = getToken({ id: user.id, role: user.role.title });
      return res.status(200).json({
        token: token,
        user: {
          user_id: user.id,
          full_name: user.full_name,
          email: user.email,
          phone_number: user.phone_number,
          role: user.role.title,
        },
      });
    } catch (error) {
      res.status(500).json({
        message: "Error occured while logged in, try Again",
        error: error.message,
      });
    }
  }
}

const userController = new userControllers();
export default userController;

