import jwt from "jsonwebtoken";
import dotenv from "dotenv";

dotenv.config();

export const getToken = (params) => {
  const token = jwt.sign(params, process.env.SECRET_KEY || "loginTokenKey", {
    expiresIn: process.env.EXPIRE_IN || "30d",
  });
  return token;
};

export const decoding = (token) => {
  const payload = jwt.verify(token, process.env.SECRET_KEY || "loginTokenKEy");
  return payload;
};

import joi from "joi";

export const userValidation = async (req, res, next) => {
  const userSchema = joi
    .object({
      phone_number: joi.string().required().messages({
        "any.required": "Phone Number required",
      }),
      password: joi.string().min(8).required().messages({
        "any.required": "Password required",
        "string.min": "Password require 8 characters",
      }),
    })
    .options({ allowUnknown: true });
  const value = await userSchema.validate(req.body);
  if (value.error) {
    res.status(400).json({
      message: value.error.details[0].message,
    });
  } else {
    next();
  }
};

import { User, Role } from "../database/models";
import { Op } from "sequelize";

export const checkUserExistByPhone = async (req, res, next) => {
  const { phone_number } = req.body;
  const user = await User.findOne({
    where: {
      [Op.and]: [{ phone_number }, { is_active: true }],
    },
  });
  if (user) {
    res.status(404).json({
      message: "User already exist",
    });
    return false;
  }
  next();
};

export const checkUserExist = async (req, res, next) => {
  const { phone_number } = req.body;
  const user = await User.findOne({
    where: {
      [Op.and]: [{ phone_number }, { is_active: true }],
    },
    include: [
      {
        model: Role,
        as: "role",
      },
    ],
  });
  if (!user) {
    res.status(404).json({
      message: "User doesn't exist, Please contact admin for support",
    });
    return false;
  }
  req.user = user;
  next();
};
